DELIMITER $$
CREATE TRIGGER `delete_cal` AFTER DELETE ON `keyvh` FOR EACH ROW BEGIN
	   
	   set @d_in:=old.d_in;
	   set @d_out:=old.d_out;
	   set @id_r:=old.id_room;
	   delete from cal where cal.id_r=@id_r and cal.day >=@d_in and cal.day<=@d_out;
	END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `insert_cal` AFTER INSERT ON `keyvh` FOR EACH ROW BEGIN
	   
	   set @day:=new.d_in;
	   set @id_r:=new.id_room;
	   set @curdate:=curdate();
	         
	   while @day <= new.d_out do
		set @day:=DATE_ADD(@day,INTERVAL 1 DAY);
	   	END WHILE;
		delete from cal where cal.day < @curdate;
	END
$$
DELIMITER ;

